import React, { useContext } from "react";
import { UserInfoContextStore } from "./Store";

const User = () => {
  const UserInfo = useContext(UserInfoContextStore);
  return <h1>USERNAME: {(UserInfo.name, UserInfo.setName)}</h1>;
};

export default User;
